    [CascadingParameter]
    public Task<AuthenticationState> authenticationState { get; set; }
    ExpenseMaster master = new ExpenseMaster();
    List<AccountLedgerView> listExpensesCategory = new List<AccountLedgerView>();
    List<Warehouse> listWarehouse = new List<Warehouse>();
    int decExpenseVoucherType = 10;
    string strSerialNo;
    string strMenu = "Expenses";
    bool strAdd = true;
    bool strEdit = true;
    bool strDelete = true;
    bool strShow = true;
    int RoleId = 1;
    Privilege privi = new Privilege();
    protected async override void OnInitialized()
    {
        //RoleId = await sessionStorage.GetItemAsync<int>("RoleId");
        //CheckPriviliage
        privi = _role.PriviliageCheck(strMenu, RoleId, 1);
        if (privi != null)
        {
            strAdd = privi.AddAction;
            strEdit = privi.EditAction;
            strDelete = privi.DeleteAction;
            strShow = privi.ShowAction;
            if (strAdd == false)
            {
                Snackbar.Add("You dont have to privilege.", Severity.Success);
                navManager.NavigateTo("dashboard");
            }
        }
        else
        {
            strAdd = true;
            strEdit = true;
            strDelete = true;
            strShow = true;
        }
        var voucherType = _voucherType.Edit(decExpenseVoucherType);
        strSerialNo = _expenseMaster.GetVoucherNo(1, 1, decExpenseVoucherType);
        master.VoucherNo = voucherType.Prefix + strSerialNo + voucherType.Suffix;
        listExpensesCategory = accountLedger.ViewAllExpensesCategory(1);
        master.Date = DateTime.Now;
        listWarehouse = _warehouse.GetAll();
        master.LedgerId = 0;
        master.WarehouseId = 0;
        StateHasChanged();
    }
    public async Task HandleValidSubmit()
    {
        if (master.WarehouseId == 0)
        {
            Snackbar.Add("Choose Warehouse.", Severity.Info);
        }
        else if (master.LedgerId == 0)
        {
            Snackbar.Add("Choose Category.", Severity.Info);
        }
        else
        {
            var authState = await authenticationState;
            var user = authState.User;
            string Id = user.Identity.Name.ToString();
            master.UserId = Id;
            master.SerialNo = strSerialNo;
            master.VoucherTypeId = decExpenseVoucherType;
            master.FinancialYearId = 1;
            master.AddedDate = DateTime.UtcNow;
            master.CompanyId = 1;
            var isCheck = _expenseMaster.ExpensesVoucherNoCheckExistence(1, 1, master.VoucherNo); //1 , 1 is company id and financialyearid
            if (isCheck == true)
            {
                Snackbar.Add("ReferenceNo Already Exists.", Severity.Info);
            }
            else
            {
                bool isSave = false;
                isSave = _expenseMaster.Save(master);
                if(isSave == true)
                {
                Snackbar.Add("Saved Successfully.", Severity.Success);
                navManager.NavigateTo("/expenses/expenseslist");
                }
                else
                {
                    Snackbar.Add("Invalid.", Severity.Error);
                }
            }
        }
    }
    void Cancel()
    {
        navManager.NavigateTo("/expenses/expenseslist");
    }
    

